import styled from 'styled-components';
import { Link } from 'react-router-dom';

export const LinkHome = styled(Link)`
display: block;
width: 4em;
text-align: center;
margin: 2em auto;
background: .5em 0;
background-color: #000;
color: #fff;
text-decoration: none;
`;

export const ErrorMsg = styled.span`
display: block;
font-size: 0.6;
ba
`;
